import React, { useState, useEffect } from 'react';
import ProductCard from './components/ProductCard';
import Chatbot from './components/Chatbot';
import './App.css';

function App() {
  const [cart, setCart] = React.useState([]);
  const [products, setProducts] = React.useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetch('http://localhost:5000/api/products')
      .then(response => response.json())
      .then(data => setProducts(data));
  }, []);

  const addToCart = (product) => {
    setCart(prev => [...prev, product]);
    // Here you would typically make an API call to add to cart
  };

  const handleProductClick = (productId) => {
    navigate(`/product/${productId}`);
  };

  return (
    <Router>
      <div className="App">
        <nav className="main-nav">
          <Link to="/" className="logo">TechStore</Link>
          <div className="nav-links">
            <Link to="/">Home</Link>
            <Link to="/categories">Categories</Link>
            <Link to="/search">Search</Link>
            <Link to="/cart" className="cart-link">
              <span className="cart-icon">ðŸ›’</span>
              <span className="cart-count">{cart.length}</span>
            </Link>
          </div>
        </nav>

        <Routes>
          <Route path="/" element={
            <div className="home-page">
              <section className="hero">
                <h1>Welcome to TechStore</h1>
                <p>Your one-stop shop for all your tech needs</p>
                <div className="featured-products">
                  {/* Add featured products here */}
                </div>
              </section>
              <main className="products-grid">
                {products.map(product => (
                  <ProductCard
                    key={product.id}
                    product={product}
                    onAddToCart={addToCart}
                    onClick={() => handleProductClick(product.id)}
                  />
                ))}
              </main>
            </div>
          } />
          <Route path="/product/:id" element={<ProductDetail />} />
          <Route path="/cart" element={<ShoppingCart />} />
          <Route path="/checkout" element={<Checkout />} />
          <Route path="/categories" element={<Categories />} />
          <Route path="/search" element={<Search />} />
        </Routes>

        <footer className="footer">
          <div className="footer-content">
            <div className="footer-section">
              <h3>Customer Service</h3>
              <ul>
                <li><Link to="/contact">Contact Us</Link></li>
                <li><Link to="/returns">Returns</Link></li>
                <li><Link to="/shipping">Shipping Info</Link></li>
              </ul>
            </div>
            <div className="footer-section">
              <h3>Quick Links</h3>
              <ul>
                <li><Link to="/about">About Us</Link></li>
                <li><Link to="/faq">FAQ</Link></li>
                <li><Link to="/privacy">Privacy Policy</Link></li>
              </ul>
            </div>
            <div className="footer-section">
              <h3>Connect With Us</h3>
              <div className="social-links">
                <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">Facebook</a>
                <a href="https://twitter.com" target="_blank" rel="noopener noreferrer">Twitter</a>
                <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">Instagram</a>
              </div>
            </div>
          </div>
          <div className="footer-bottom">
            <p>&copy; {new Date().getFullYear()} TechStore. All rights reserved.</p>
          </div>
        </footer>
        <Chatbot />
      </div>
    </Router>
  );
}

export default App;
